def loops(s, vars):
    or_constraints = []

    for loop in ALL_POSSIBLE_LOOPS:
        # Each digit on the loop indicates exactly how many times that digit
        # appears on the loop.
        # Eg: If there's a 5 on the loop, it means there are five 5s on the loop
        and_constraints = []
        for digit in range(1, 10):
            count = z3.Sum([z3.If(vars[r][c] == digit, 1, 0) for c, r in loop])

            and_constraints.append(z3.Or(count == digit, count == 0))

        or_constraints.append(z3.And(and_constraints))

    s.add(z3.Or(or_constraints))


s = (
    Solver(Solver.EMPTY)
    .white_kropkis([
        [(6, 0), (6, 1)],
        [(6, 3), (7, 3)],
        [(5, 3), (5, 4)],
        [(1, 7), (2, 7)],
    ])
    .thermo([(0, 0), (1, 0), (0, 1)])
    .thermo([(4, 0), (3, 1), (2, 1)])
    .thermo([(8, 0), (8, 1), (7, 0)])
    .thermo([(7, 2), (6, 3)])
    .thermo([(0, 4), (0, 3)])
    .thermo([(8, 4), (8, 5), (8, 6)])
    .thermo([(1, 5), (0, 4)])
    .thermo([(0, 8), (1, 7), (2, 8), (1, 8)])
    .thermo([(3, 8), (3, 7), (3, 6), (3, 5)])
    .thermo([(5, 8), (5, 7)])
    .thermo([(7, 8), (7, 7), (8, 8), (8, 7)])
    .extra_constraint(loops)
)

solution = s.solve()

Solver.pretty_print(solution)
